import React from 'react';

function FuentesDatos() {
  return (
    <div className="tarjeta">
      <h2>Fuentes de datos</h2>
      <p>Fuente: MINVIVIENDA AGUA SANEAMIENTO</p>
      <p>Total: 1</p>
    </div>
  );
}

export default FuentesDatos;
